import React from 'react';
import {Link} from "react-router-dom";


const Navbar = () => {


  return (
    //   <ul className='navbar'>
    <li>
      <Link style={{color:'black'}} className='home' to="/"> Home </Link>
      <Link style={{color:'black'}} className='list' to="/list"> List </Link>
      <Link style={{color:'black'}} className='login' to="/login"> Log in </Link>
    </li>
    // </ul>
  );
}
export default Navbar;
